package ir.ac.aut.god.automatanewentries;

import java.io.File;
import java.io.FileNotFoundException;
import java.util.Scanner;

/**
 * created By aMIN on 5/11/2019 4:56 PM
 */

public class Run {
    public static void main(String[] args) throws FileNotFoundException {
        Scanner scanner = new Scanner(new File("conf/AutoFile"));

        String number = "44516515615615165156165165156156156156156" +
                "" +
                "" +
                "" +
                "" +
                "" +
                ""
                +"0";
        String[] number_digits = number.split("");
        System.out.println(number_digits.length);

        String[][] strings = new String[6][6];

        int k=0;
        while (scanner.hasNextLine()) {

            String nextLine = scanner.nextLine();
            String[] states = nextLine.split(",");
            for (int i = 0; i < states.length; i++) {
                strings[k][i] = states[i];
            }
            k++;
        }

        int p=0;
        for (String number_digit : number_digits) {
            String mapped = String.valueOf(Integer.parseInt(number_digit) % 6);
            int digit = Integer.parseInt(mapped);
            String newSt = strings[p][digit];
            p = Integer.parseInt(newSt);
        }

        System.out.println(p);




    }
}
